import ButtonComponent from "../atoms/Button/ButtonComponent";
import { ThemeProvider } from 'theme-ui';
import { theme } from '../theme';

export default {
    title: "Button",
    component: ButtonComponent,
  };

  function Settings() {
      return(
        <ThemeProvider theme={theme}>

        <ButtonComponent
          styles={{ backgroundColor: "buttonBackground", color: "buttonText" }}
          handleClick={(event) => {
            console.log("Clicked me");
          }}
        >
          Click me
        </ButtonComponent>
      </ThemeProvider>
      )
  }

export {Settings}
